import axios from "axios";
import {
  POST_SUCCESS,
  POST_FAIL,
  USER_REGISTER_FAIL,
  USER_REGISTER_SUCCESS,
  USER_AUTH_SUCCESS,
  USER_AUTH_FAIL,
  USER_LOGOUT_FAIL,
} from "../constants/exampleConstants";
import { push } from "connected-react-router";
const postExample = (title, body, userId) => async (dispatch) => {
  try {
    const { data } = await axios.post(
      "https://jsonplaceholder.typicode.com/posts",
      JSON.stringify({
        title: title,
        body: body,
        userId: userId,
      })
    );
    console.log("post action", data)
    dispatch({ type: POST_SUCCESS, payload: data });
  } catch (error) {
    dispatch({ type: POST_FAIL, payload: error.response.data });
  }
};

const getExample = () => async (dispatch) => {
  try {
    const { data } = await axios.get("/api/users/logout");
    if (!data) {
      dispatch(push("/login"));
    }
  } catch (error) {
    dispatch({ type: USER_LOGOUT_FAIL, payload: error.response.data });
  }
};

const putExample = (userName, name, email, password) => async (dispatch) => {
  try {
    const { data } = await axios.post(
      "/api/users/register",
      { userName, name, email, password },
      {
        withCredentials: true,
      }
    );
    dispatch({ type: USER_REGISTER_SUCCESS, payload: data });
  } catch (error) {
    dispatch({
      type: USER_REGISTER_FAIL,
      payload: error.response.data,
    });
  }
};

const deleteExample = () => async (dispatch) => {
  try {
    const { data } = await axios.get("/api/users/user");
    dispatch({ type: USER_AUTH_SUCCESS, payload: data });
  } catch (error) {
    dispatch({ type: USER_AUTH_FAIL, payload: error.response.data });
  }
};
export { postExample, getExample, putExample, deleteExample };
